import React from 'react';
import { PageProvider } from './components/PageContext'; // Importez le contexte
import CardsWrapper from './components/CardsWrapper';
import NavbarRight from './components/navbar/navbarright';

function App() {
  return (
    <PageProvider>
      <NavbarRight />
      <CardsWrapper />
    </PageProvider>
  );
}

export default App;
